        [TestMethod]
        [DataRow(false, DisplayName = "Without annotations")]
        [DataRow(true, DisplayName = "With annotations")]
        public void ConvertPages(bool withAnnotations = false)
        {
            using var inputStream = new FileStream(Path.Combine("Assets", "Wikimedia_Commons_web.pdf"), FileMode.Open, FileAccess.Read);

            int page = 0;

            foreach (var zplCode in ConvertPdf(inputStream, dpi: 40, withAnnotations: withAnnotations))
            {
                Assert.AreEqual(withAnnotations ? _expectedZplResultsWithAnnotations[page] : _expectedZplResults[page], zplCode);

                page++;
            }

            Assert.AreEqual(_expectedZplResults.Length, page);
        }

#if NET6_0_OR_GREATER
        [TestMethod]
        [DataRow(false, DisplayName = "Without annotations")]
        [DataRow(true, DisplayName = "With annotations")]
        public async Task ConvertPagesAsync(bool withAnnotations = false)
        {
            using var inputStream = new FileStream(Path.Combine("Assets", "Wikimedia_Commons_web.pdf"), FileMode.Open, FileAccess.Read);

            int page = 0;

            await foreach (var zplCode in ConvertPdfAsync(inputStream, dpi: 40, withAnnotations: withAnnotations))
            {
                Assert.AreEqual(withAnnotations ? _expectedZplResultsWithAnnotations[page] : _expectedZplResults[page], zplCode);

                page++;
            }

            Assert.AreEqual(_expectedZplResults.Length, page);
        }

        [TestMethod]
        public async Task ToImagesAsyncTaskCanceledException()
        {
            using var inputStream = new FileStream(Path.Combine("Assets", "Wikimedia_Commons_web.pdf"), FileMode.Open, FileAccess.Read);
            var token = new CancellationTokenSource();

            await Assert.ThrowsExceptionAsync<TaskCanceledException>(async () =>
            {
                token.Cancel();

                await foreach (var image in ConvertPdfAsync(inputStream, dpi: 1200, cancellationToken: token.Token))
                {
                }
            });
        }

        [TestMethod]
        public async Task ToImagesAsyncOperationCanceledException()
        {
            using var inputStream = new FileStream(Path.Combine("Assets", "Wikimedia_Commons_web.pdf"), FileMode.Open, FileAccess.Read);
            var token = new CancellationTokenSource();

            await Assert.ThrowsExceptionAsync<OperationCanceledException>(async () =>
            {
                await foreach (var image in ConvertPdfAsync(inputStream, dpi: 1200, cancellationToken: token.Token))
                {
                    token.Cancel();
                }
            });
        }
#endif
